import React from 'react'
import { StyleSheet, Text, View } from 'react-native'
import {ListItem,Avatar} from 'react-native-elements'
const CustomListItem = () => {
    return (
        <ListItem>
            <Avatar
            rounded 
            source={{
                uri:"https://upload.wikimedia.org/wikipedia/commons/thumb/0/0e/Michael_C_Hall_2011_2b.jpg/1200px-Michael_C_Hall_2011_2b.jpg"
            }}
            />
            <ListItem.Content>
                <ListItem.Title style={{fontWeight:600}}>Dex-Fam</ListItem.Title>
                <ListItem.Subtitle numberOfLines={1} ellipsizeMode="head">
                    This is a test Subtitle

                </ListItem.Subtitle>
            </ListItem.Content>
        </ListItem>
    )
}

export default CustomListItem

const styles = StyleSheet.create({})
